package com.jiagouedu.services.manage.catalog.dao.impl;import com.jiagouedu.core.dao.BaseDao;import com.jiagouedu.core.dao.page.PagerModel;import com.jiagouedu.services.manage.catalog.bean.FrontCatalog;import com.jiagouedu.services.manage.catalog.dao.FrontCatalogDao;import org.springframework.stereotype.Repository;import javax.annotation.Resource;import java.util.List;@Repository("frontCatalogDao")public class FrontCatalogDaoImpl implements FrontCatalogDao {    @Resource	private BaseDao dao;	public void setDao(BaseDao dao) {		this.dao = dao;	}	public List selectList(FrontCatalog e) {		return dao.selectList("manage.catalog.selectListToCache", e);	}}